const ForumHeader = () => {
    return ( 
        <div className="forum-header">
            <p>Categorie</p>
            <p>Titre</p>
            <p>Auteur</p>
            <p>Nb reponses</p>
            <p>Derniere reponse</p>
        </div>
     );
}

export default ForumHeader;
